import Axios from 'axios';
import React from 'react';
import './App.css';

function App() {
  let rooms 
  Axios({
    method: 'get',
    url: 'https://localhost:8080/chat/rooms',
    responseType: 'stream'
  })
    .then(function (response) {
      rooms = response.data
    });
  return (
    <div className="App">
        <h1>{rooms}</h1>
    </div>
  );
}

export default App;
